import Header from '../../Header/Header';
import Footer from '../../../components/Footer/Footer';
import { Button } from 'primereact/button';
import AccountDetailPage from '../AccountDetailPage/AccountDetailPage';
import AccountSessionPage from '../AccountSessionPage/AccountSessionPage';
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from "react-router-dom";

function AccountDetail() {
    const history = useHistory();

    return (
        <div className="body-container">
            <Header/>
            <div className="p-grid">
                <div className="p-col-12 p-sm-2 p-md-2"/>
                <div className="p-col-12 p-sm-1">
                    <div className="p-grid p-mb-3"><Button icon="pi pi-user" label="Thông tin" className="p-button-rounded p-button-info" style={{width:'100%'}}/></div>
                    <div className="p-grid p-mb-3"><Button icon="pi pi-wallet" label="Hoá đơn" className="p-button-rounded p-button-info" style={{width:'100%'}}/></div>
                    <div className="p-grid p-mb-3"><Button icon="pi pi-key" label="Đổi mật khẩu" className="p-button-rounded p-button-info" style={{width:'100%'}}/></div>
                </div>
                <div className="p-col-12 p-sm-8 p-md-8" >
                    <AccountDetailPage/>
                    <Router>
                        <Switch>
                            <Route exact path={'/account/info'}><AccountDetailPage/></Route>
                            <Route exact path={'/account/receipt'}><AccountSessionPage/></Route>
                        </Switch>
                    </Router>
                </div>
            </div>
            <Footer/>
        </div>
    )
}

export default AccountDetail
